# Lista das disciplinas (baseada nos seus scripts)
disciplinas = [
    'ARTE', 'BIOLOGIA', 'EDUCA√á√ÉO F√çSICA', 'FILOSOFIA', 'F√çSICA', 'GEOGRAFIA',
    'HIST√ìRIA', 'L√çNGUA INGLESA', 'L√çNGUA PORTUGUESA', 'MATEM√ÅTICA',
    'PR√ÅTICAS DE MAT E CNT NO TERRIT√ìRIO', 'PR√ÅTICAS DE LGG E CHS NO TERRIT√ìRIO',
    'PROJETO DE VIDA', 'QU√çMICA', 'SOCIOLOGIA',
    'TEMAS DE APROFUNDAMENTO MAT E CNT', 'TEMAS DE APROFUNDAMENTO LGG E CHS'
]

def inserir_titulo(ws, titulo):
    ws.insert_rows(1)
    ws['A1'] = titulo
    ws['A1'].font = Font(bold=True, size=14)
    ws['A1'].alignment = Alignment(horizontal='center')

    max_col = ws.max_column
    if max_col > 1:
        ws.merge_cells(start_row=1, start_column=1, end_row=1, end_column=max_col)

def ajustar_largura_colunas(worksheet):
    for i, col in enumerate(worksheet.columns, 1):
        max_length = 0
        for cell in col:
            try:
                if cell.value:
                    max_length = max(max_length, len(str(cell.value)))
            except:
                pass
        column_letter = get_column_letter(i)
        worksheet.column_dimensions[column_letter].width = max_length + 2

def extrair_codigo_turma(arquivo_upload):
    """Extrai o c√≥digo da turma da c√©lula A3"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=None, nrows=3)
        texto = str(df.iloc[2, 0])
        # Procura por padr√£o "turma CODIGO."
        match = re.search(r'turma ([A-Z0-9]+)\.', texto)
        if match:
            return match.group(1)
        else:
            return "Turma_Desconhecida"
    except Exception:
        return "Turma_Desconhecida"

def count_low_grades(arquivo_upload):
    """Baseado no script count_low_grades.py"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=[7,8])

        if df.empty:
            return None, "Arquivo est√° vazio"

        # Encontrar coluna do estudante
        nome_col = [c for c in df.columns if 'ESTUDANTE' in str(c[0]).upper()]
        if nome_col:
            df_alunos = df[df[nome_col[0]].notna() & (df[nome_col[0]].astype(str).str.strip() != '')].copy()
        else:
            df_alunos = df.copy()

        if df_alunos.empty:
            return None, "Nenhum aluno encontrado"

        resumo = []

        for disc in disciplinas:
            col = None
            for c in df_alunos.columns:
                if disc == str(c[0]).upper().strip() and '1' in str(c[1]):
                    col = c
                    break

            if col is not None:
                notas = df_alunos[col]
                abaixo_6 = notas.apply(lambda x: pd.notna(x) and isinstance(x, (int, float)) and x < 6).sum()
                sem_nota = notas.isna().sum() + (notas.astype(str).str.strip() == '').sum()

                resumo.append({
                    'Disciplina': disc,
                    'Alunos com nota < 6': abaixo_6,
                    'Alunos sem nota': sem_nota
                })

        df_resumo = pd.DataFrame(resumo)
        return df_resumo, None

    except Exception as e:
        return None, f"Erro ao processar: {e}"

def contar_disciplinas_por_aluno(arquivo_upload):
    """Baseado no script contar_disciplinas.py"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=[7,8])

        # Encontrar colunas de n√∫mero e nome do aluno
        num_col = None
        nome_col = None
        for c in df.columns:
            if 'N¬∫' == str(c[0]).strip():
                num_col = c
            if 'ESTUDANTE' in str(c[0]).upper():
                nome_col = c

        if num_col is None or nome_col is None:
            return None, "Colunas 'N¬∫' ou 'ESTUDANTE' n√£o encontradas"

        # Filtrar linhas v√°lidas
        df_alunos = df[df[nome_col].notna() & (df[nome_col].astype(str).str.strip() != '')].copy()

        # Encontrar colunas do 1¬∫ bimestre
        colunas_1b = []
        for disc in disciplinas:
            for c in df_alunos.columns:
                if disc == str(c[0]).upper().strip() and '1' in str(c[1]):
                    colunas_1b.append((disc, c))
                    break

        def contar_notas_baixas(row):
            count = 0
            disciplinas_baixas = []
            for disc, col in colunas_1b:
                val = row[col]
                if pd.notna(val):
                    try:
                        if float(val) < 6.0:
                            count += 1
                            disciplinas_baixas.append(disc)
                    except:
                        pass
            return count, ', '.join(disciplinas_baixas)

        resultados = df_alunos.apply(contar_notas_baixas, axis=1)
        contagem = resultados.apply(lambda x: x[0])
        nomes_disciplinas = resultados.apply(lambda x: x[1])

        df_resumo = pd.DataFrame({
            'N¬∫': df_alunos[num_col],
            'Estudante': df_alunos[nome_col],
            'Notas Baixas': contagem,
            'Disciplinas com Notas Baixas': nomes_disciplinas
        })

        return df_resumo, None

    except Exception as e:
        return None, f"Erro ao processar: {e}"

def verificar_disciplinas_sem_nota(arquivo_upload):
    """Baseado no script verifica_notas.py"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=[7,8])
        disciplinas_sem_nota = []

        for disc in disciplinas:
            col = None
            for c in df.columns:
                if disc == str(c[0]).upper().strip() and '1' in str(c[1]):
                    col = c
                    break

            if col is not None:
                # Verifica se h√° algum valor num√©rico na coluna
                tem_nota = df[col].notna().any()
                if not tem_nota:
                    disciplinas_sem_nota.append(disc)

        return disciplinas_sem_nota, None

    except Exception as e:
        return None, f"Erro ao processar: {e}"

def processar_arquivo(arquivo_upload):
    """Processa um √∫nico arquivo e retorna todos os resultados"""
    codigo_turma = extrair_codigo_turma(arquivo_upload)

    # An√°lise 1: Resumo por disciplina
    df_resumo1, erro1 = count_low_grades(arquivo_upload)

    # An√°lise 2: Resumo por aluno
    df_resumo2, erro2 = contar_disciplinas_por_aluno(arquivo_upload)

    # An√°lise 3: Disciplinas sem nota
    disciplinas_sem_nota, erro3 = verificar_disciplinas_sem_nota(arquivo_upload)

    return {
        'codigo_turma': codigo_turma,
        'arquivo_nome': arquivo_upload.name,
        'resumo_disciplina': df_resumo1,
        'resumo_aluno': df_resumo2,
        'disciplinas_sem_nota': disciplinas_sem_nota,
        'erros': [erro1, erro2, erro3]
    }

def criar_excel_multiplas_turmas(resultados_turmas):
    output = BytesIO()

    with pd.ExcelWriter(output, engine='openpyxl') as writer:
        for resultado in resultados_turmas:
            codigo_turma = resultado['codigo_turma']

            if resultado['resumo_disciplina'] is not None:
                nome_aba = f"{codigo_turma}_Disciplinas"[:31]
                resultado['resumo_disciplina'].to_excel(writer, sheet_name=nome_aba, index=False)

            if resultado['resumo_aluno'] is not None:
                nome_aba = f"{codigo_turma}_Alunos"[:31]
                resultado['resumo_aluno'].to_excel(writer, sheet_name=nome_aba, index=False)

            if resultado['disciplinas_sem_nota']:
                nome_aba = f"{codigo_turma}_SemNota"[:31]
                df_sem_nota = pd.DataFrame({'Disciplinas sem Nota': resultado['disciplinas_sem_nota']})
                df_sem_nota.to_excel(writer, sheet_name=nome_aba, index=False)

    output.seek(0)
    wb = load_workbook(output)
    for ws in wb.worksheets:
        # Extrai o c√≥digo da turma do nome da aba
        codigo_turma = ws.title.split('_')[0]
        inserir_titulo(ws, f"Turma: {codigo_turma}")
        ajustar_largura_colunas(ws)

    output2 = BytesIO()
    wb.save(output2)
    output2.seek(0)
    return output2

def montar_consolidado(resultados_turmas):
    """
    Monta um DataFrame consolidado com disciplinas nas linhas e turmas nas colunas,
    mostrando a quantidade de alunos com notas baixas (<6) por disciplina em cada turma.
    """
    # DataFrame vazio para armazenar o consolidado
    df_consolidado = pd.DataFrame()

    # Para cada turma processada
    for resultado in resultados_turmas:
        codigo_turma = resultado['codigo_turma']
        resumo_disciplina = resultado['resumo_disciplina']

        # Se a turma foi processada com sucesso
        if resumo_disciplina is not None:
            # Cria uma s√©rie com disciplinas como √≠ndice e quantidade de alunos com nota baixa como valores
            serie_turma = resumo_disciplina.set_index('Disciplina')['Alunos com nota < 6']

            # Adiciona a s√©rie como uma nova coluna no DataFrame consolidado
            df_consolidado[codigo_turma] = serie_turma

    # Preenche valores ausentes com 0 (disciplinas que n√£o existem em algumas turmas)
    df_consolidado = df_consolidado.fillna(0)

    # Converte para inteiros (remove decimais desnecess√°rios)
    df_consolidado = df_consolidado.astype(int)

    # Ordena as disciplinas alfabeticamente
    df_consolidado = df_consolidado.sort_index()

    # Adiciona uma coluna "Total" com a soma de todas as turmas
    df_consolidado['TOTAL'] = df_consolidado.sum(axis=1)

    return df_consolidado

def gerar_excel_consolidado(df_consolidado):
    """Gera um arquivo Excel apenas com o relat√≥rio consolidado"""
    output = BytesIO()

    with pd.ExcelWriter(output, engine='openpyxl') as writer:
        df_consolidado.to_excel(writer, sheet_name='Consolidado', index=True)

    output.seek(0)

    # Ajusta largura das colunas
    wb = load_workbook(output)
    ws = wb['Consolidado']

    # Adiciona t√≠tulo
    ws.insert_rows(1)
    ws['A1'] = 'RELAT√ìRIO CONSOLIDADO - ALUNOS COM NOTAS BAIXAS POR DISCIPLINA'
    ws['A1'].font = Font(bold=True, size=14)
    ws['A1'].alignment = Alignment(horizontal='center')
    ws.merge_cells(start_row=1, start_column=1, end_row=1, end_column=ws.max_column)

    # Ajusta largura das colunas
    ajustar_largura_colunas(ws)

    output2 = BytesIO()
    wb.save(output2)
    output2.seek(0)
    return output2

